import React, { useState } from "react";
import stylesheet from './styles.js';
import { useNavigate } from 'react-router-dom';

const Button = (props) => {
  const [cls, setCls] = useState("default");
  const navigate = useNavigate();

  return (
    <>
      <style>{`
      	.default {
      		width: 140px;
			height: 35px;
			border-radius: 50px;
			border: 2px solid grey;
			text-align: 'center';
			justify-content: 'center';
			position: relative;
			top: 50vh;
			left: 94vh;
      color: white;
      letter-spacing: 1px;
      background: rgb(6,188,193);
      background: radial-gradient(circle, rgba(6,188,193,1) 0%, rgba(18,38,58,1) 100%);
			font-family: sans-serif;
			font-weight: bolder;
			background-color: #06BCC1;

      	}
        .default:hover {
 			opacity: 0.2;

        }

      `}</style>
      <button
        className={cls}
        onClick={() => navigate(props.path)}
      >
        {props.text}
      </button>
    </>
  );
}

export default Button;
